  "text" : "\uC6B0\uCE21\uBCF4\uD589, \uC678\uBD80 \uACF5\uACF5\uC7A5\uC18C\uC5D0\uC11C\uC758 \uAE08\uC5F0, \uC5D0\uC2A4\uCEEC\uB808\uC774\uD130 \uB450\uC904 \uC11C\uAE30 \uBB38\uD654 \uC2DC\uBBFC\uC73C\uB85C\uC11C \uB2F9\uC2E0\uC774 \uBC18\uB4DC\uC2DC \uC9C0\uCF1C\uC57C\uD560 \uCD5C\uC18C\uD55C\uC758 \uADDC\uCE59\uC785\uB2C8\uB2E4. \uD2B9\uD788 \uACF5\uACF5\uC7A5\uC18C\uC5D0\uC11C \uBB34\uC2DD\uD558\uAC8C \uB2F4\uBC30 \uAF2C\uB098\uBB3C\uACE0 \uC788\uB294 \uC80A\uC740\uC774\uC640 \uB299\uC740\uC774\uB4E4\uC744 \uBCF4\uAD6C \uC788\uB178\uB77C\uBA74 \uADF8\uB0E5 \uB2EC\uB824\uC624\uB294 \uC804\uCCA0\uC5D0 \uBC00\uC5B4\uBC84\uB9AC\uACE0 \uC2F6\uC5B4\uC9D1\uB2C8\uB2E4.",
