  "text" : "\uC6B0\uB9AC \uB098\uB77C\uB294 \uC808\uB300\uB85C \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB85C \uC131\uACF5\uD560 \uC218 \uC5C6\uB294 \uB098\uB77C\uB2E4. \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB294 \uC0C1\uC0C1\uC744 \uD604\uC2E4\uD654 \uC2DC\uD0A4\uB294 \uB2A5\uB825\uC774 \uD544\uC694\uD55C\uB370.. \uC6B8 \uB098\uB77C \uAD50\uC721 \uC5B4\uB514\uB3C4 \uADF8\uB7F0\uAC70 \uAC00\uB974\uCE58\uB294 \uACF3\uC740 \uC5C6\uB2E4. \uC0C1\uC0C1\uC744 \uD604\uC2E4\uD654 \uD558\uB294 \uB2A5\uB825\uC740 \uD0C0\uACE0\uB098\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C \uC5F0\uC2B5\uACFC \uD559\uC2B5\uC73C\uB85C \uB9CC\uB4E4\uC5B4\uC9C0\uB294 \uAC83\uC774\uB2E4.",
