  "text" : "\uB0B4\uAC00 \uC54C\uAE30\uB85C \uC624\uD508\uC6F9\uC5D0\uC11C \uACF5\uC778\uC778\uC99D\uC11C \uC790\uCCB4\uB97C \uBD80\uC815\uD55C \uC801\uC740 \uC5C6\uB2E4\uACE0 \uC54C\uACE0 \uC788\uB2E4. \uACF5\uC778 \uC778\uC99D\uC740 \uD544\uC694\uD560 \uC218\uB3C4 \uD544\uC694\uD558\uC9C0 \uC54A\uC744 \uC218\uB3C4 \uC788\uB2E4. \uBB38\uC81C\uB294 \uACF5\uC778 \uC778\uC99D\uC774 \uACF5\uC778 \uC778\uC99D\uC758 \uC790\uACA9\uC744 \uAC00\uC9C0\uACE0 \uC788\uB290\uB0D0\uB294 \uAC83\uC774\uB2E4. \uC774\uAC83\uC740 \uC2E0\uB8B0\uC758 \uBB38\uC81C\uC774\uB2E4. \uC2E0\uB8B0\uD560\uC218 \uC788\uB2E4\uBA74 \uC4F0\uB294 \uAC83\uC774 \uB9DE\uB2E4,",
