  "text" : "\uC624\uD508\uC6F9\uC758 \uCC2C\uBC18 \uC591\uB860\uC774 \uBCF4\uC548\uC73C\uB85C\uB9CC \uCE58\uB2EB\uB294 \uAF2C\uB77C\uC9C0\uB97C \uBCF4\uBA74 \uD669\uB2F9\uD558\uAE30 \uADF8\uC9C0 \uC5C6\uB2E4. \uC774\uAC74 \uC232\uC740 \uBABB\uBCF4\uACE0 \uB098\uBB34\uB9CC \uBCF4\uB294 \uAF2C\uB77C\uC9C0\uAC00 \uC544\uB2CC\uAC00? \uC911\uC694\uD55C \uAC83\uC740 \uACF5\uC815\uD55C \uACBD\uC7C1\uACFC \uC120\uD0DD\uC758 \uBB38\uC81C\uC774\uB2E4. \uC740\uD589\uC774 \uC561\uD2F0\uBE0C\uC5D1\uC2A4\uB9CC \uACE0\uC9D1\uD558\uB358 \uB9D0\uB358 \uAD00\uC2EC \uC5C6\uB2E4.",
