  "text" : "\uBB38\uC81C\uB294 \uC561\uD2F0\uBE0C\uC5D1\uC2A4\uB9CC \uACE0\uC9D1\uD560 \uC774\uC720\uAC00 \uC5C6\uB2E4\uB294 \uAC83\uC774\uB2E4. \uD30C\uD3ED\uC774\uB098 \uC0AC\uD30C\uB9AC \uAC19\uC740 \uB2E4\uB978 \uD658\uACBD\uC5D0 \uB3D9\uB4F1\uD55C \uAE30\uD68C\uB294 \uC8FC\uC5B4\uC57C \uD558\uB294 \uAC83\uC774 \uC544\uB2CC\uAC00? \uD30C\uD3ED\uC774\uB098 \uC0AC\uD30C\uB9AC\uAC00 \uC561\uD2F0\uBE0C\uC5D1\uC2A4\uB97C \uC0AC\uC6A9\uD558\uC9C0 \uC54A\uB294\uB2E4 \uD574\uC11C \uBCF4\uC548\uD574 \uCDE8\uC57D\uD55C \uAC83\uB3C4 \uC544\uB2C8\uACE0. \uBCF4\uC548\uC740 \uC5B4\uB5BB\uAC8C \uD574\uB3C4 \uB6AB\uB9AC\uAC8C \uB418\uC5B4 \uC788\uB294 \uBC95\uC778\uB370.",
