  "text" : "\uB0B4\uAC00 MS\uB97C \uC2EB\uC5B4\uD558\uB294 \uC774\uC720\uB294 \uC2DC\uC7A5 \uC9C0\uBC30\uC801\uC778 \uC785\uC7A5\uC5D0\uC11C \uC0AC\uC6A9\uC790\uC5D0\uAC8C \uC77C\uBC29\uC801\uC778 \uAC15\uC694\uB97C \uD558\uB294 \uAF2C\uB77C\uC9C0\uAC00 \uC2EB\uC5B4\uC11C\uC774\uB2E4. \uADF8\uB4E4\uC740 \uAE30\uC220\uC758 \uACF5\uC720, \uB300\uD654, \uD45C\uC900 \uC9C0\uC591\uACFC\uB294 \uC544\uBB34\uB7F0 \uC0C1\uAD00\uC774 \uC5C6\uB294 \uC9D1\uB2E8\uC774\uB2E4. IT \uC5C5\uACC4\uC5D0\uC11C \uC790\uAE30\uB9CC\uC774 \uC0B4\uC544\uB0A8\uB294 \uADF8\uB0A0\uAE4C\uC9C0 MS\uB294 \uCD5C\uC120\uC744 \uB2E4\uD560 \uAC83\uC774\uB2E4.",
