  "text" : "\uC804 \uAC1C\uC778\uC801\uC73C\uB85C \uB300\uD559\uC740 \uC815\uB9D0 \uD559\uBB38\uC744 \uC5F0\uAD6C\uD558\uB294 \uACF3\uC73C\uB85C \uB0A8\uC544\uC57C \uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uC774\uAC74 \uAC1C\uB098 \uC18C\uB098 \uBB34\uC870\uAC74 \uB300\uD559\uC740 \uCCD0\uB4E4\uC5B4\uAC00\uC57C\uD55C\uB2E4\uB294 \uC774 \uC369\uC5B4\uBE60\uC9C4 \uAD50\uC721\uACFC\uC815 \uC804\uCCB4\uB97C \uAC1C\uBC15\uC0B4\uB0B4\uC57C \uD569\uB2C8\uB2E4. \uC778\uBB38 \uACE0\uB4F1\uD559\uAD50\uB294 \uC815\uB9D0 \uB300\uD559\uAD50\uB97C \uAC00\uACE0 \uC2F6\uC740 \uC560\uB4E4\uB9CC \uAC00\uB3C4\uB85D \uD574\uC57C \uD569\uB2C8\uB2E4.",
