  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C \uD55C\uB54C \uAD50\uC721\uACC4\uC5D0 \uC0B4\uC9DD \uBC1C\uB2F4\uAD6C\uC5C8\uB358 \uC0AC\uB78C\uC73C\uB85C \uB4DC\uB294 \uC0DD\uAC01\uC740 \uAE30\uBCF8\uC801\uC778 \uC778\uC131\uAD50\uC721 \uB4F1\uC740 \uAD6D\uAC00\uAC00 \uCC45\uC784\uC9C4\uB2E4\uACE0 \uD574\uB3C4 \uC9C1\uC5C5\uAD50\uC721\uC774\uB098 \uAE30\uC220 \uAD50\uC721\uC740 \uAE30\uC5C5\uC5D0 \uC804\uBA74 \uAC1C\uBC29\uD588\uC73C\uBA74 \uD558\uB294 \uBC14\uB7A8\uC785\uB2C8\uB2E4. \uD604\uC5C5\uC758 \uAC1C\uBC1C\uC790\uB098 \uAE30\uC220\uC790\uC5D0\uAC8C \uD2B9\uC815 \uC790\uACA9 \uC2DC\uD5D8\uC744 \uD1B5\uD574 \uAD50\uC0AC\uB85C \uC804\uBA74 \uCC44\uC6A9\uD588\uC74C",
