  "text" : "\uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uAC1C\uBC1C\uD558\uB2E4\uBCF4\uBA74 \uBD84\uBA85 \uB2E8\uAE30\uC801\uC778 \uC131\uACFC\uB97C \uB0BC \uC218 \uC788\uB294 \uB9CE\uC740 \uBC29\uBC95\uB4E4\uC774 \uC788\uB2E4. \uD558\uC9C0\uB9CC \uADF8\uB7F0 \uBC29\uBC95\uB4E4\uC774 \uACFC\uC5F0 \uC5BC\uB9C8\uB098 \uC9C0\uC18D \uB420 \uC218 \uC788\uC744\uAE4C? \uC601\uC18D\uC131\uC774\uB77C\uB294 \uAC1C\uB150\uC744 \uC0DD\uAC01\uD558\uB294 \uACBD\uC601\uC9C4\uACFC \uAD00\uB9AC\uC790\uB4E4\uC774 \uB9CE\uC544\uC84C\uC73C\uBA74 \uD55C\uB2E4.",
