  "text" : "\uC138\uC0C1\uC5D0\uC11C \uAC00\uC7A5 \uD558\uAE30 \uC5B4\uB824\uC6B4 \uAC83\uC740 \uC6D0\uCE59, \uC0C1\uC2DD, \uC9C4\uC2E4\uACFC \uAC19\uC740 \uAC83\uC774\uB2E4. \uC0AC\uB78C\uB4E4\uC740 \uB108\uBB34 \uC27D\uAC8C \uD0C0\uD611\uC744 \uD55C\uB2E4. \uADF8\uB9AC\uACE0 \uADF8\uAC83\uC5D0 \uB300\uD55C \uD639\uB3C5\uD55C \uB300\uAC00\uB97C \uC9C0\uBD88\uD558\uC9C0\uB9CC \uC808\uB300 \uD559\uC2B5\uC740 \uB418\uC9C0 \uC54A\uB294\uB2E4. \uC0AC\uB78C\uC774 \uC778\uC9C0 \uBD80\uC870\uD654 \uC0C1\uD0DC\uB97C \uADF9\uBCF5\uD558\uAE30 \uC704\uD574\uC11C\uB294 \uC5B4\uB5A4 \uB178\uB825\uC744 \uD574\uC57C\uD560\uAE4C?",
