  "text" : "\uBCF4\uC11D\uC758 \uC6D0\uC11D\uC740 \uADF8\uB0E5 \uB3CC\uC77C \uBFD0\uC774\uB2E4. \uB3CC\uB9F9\uC774\uC5D0\uC11C \uBCF4\uC11D\uC744 \uAEBC\uB0B4\uAE30 \uC704\uD574\uC11C\uB294 \uADF8\uC5D0 \uB9DE\uB294 \uBC29\uBC95\uC774 \uD544\uC694\uD558\uB2E4. \uC774\uAC83\uC774 \uC131\uACFC \uCE21\uC815\uC744 \uBC18\uB300\uD558\uB294 \uC774\uC720\uC774\uB2E4. \uBAA8\uB4E0 \uC0AC\uB78C\uC744 \uAC19\uC740 \uC7A3\uB300\uB85C \uD3C9\uAC00\uD558\uB294 \uAC83\uC740 \uC5B4\uB9AC \uC11D\uC740 \uAC83\uC774\uB2E4.",
