  "text" : "\uCF04\uD2B8\uBCA1 \uC138\uBBF8\uB098\uC5D0 \uAC14\uB2E4\uC640\uC11C \uC0DD\uAC01\uC744 \uC815\uB9AC \uC911\uC785\uB2C8\uB2E4. \uC870\uB9CC\uAC04 \uBE14\uB85C\uADF8\uC5D0 \uC815\uB9AC\uD574 \uBCFC \uC0DD\uAC01\uC785\uB2C8\uB2E4. \uAC70\uC758 2\uB144 \uC9F8 \uC560\uC790\uC77C \uC9C4\uC601\uC744 \uCAD3\uC544\uB2E4\uB2C8\uBA74\uC11C \uB290\uB07C\uB294 \uAC74\uB370.. \uC560\uC790\uC77C \uC9C4\uC601\uC5D0\uC11C \uD14C\uC2A4\uD130\uC758 \uD3EC\uC9C0\uC158\uC774 \uAC08 \uC218\uB85D \uC560\uB9E4\uD574\uC9C0\uB294 \uAC83 \uAC19\uC2B5\uB2C8\uB2E4.",
