  "text" : "\uBCC4\uB85C \uB299\uC9C0\uB3C4 \uC54A\uC558\uB294\uB370.. \uD558\uB8E8 \uB0A0\uBC24\uC744 \uC0C8\uBA74 \uBAB8\uC774 \uBC84\uD168\uB098\uC9C0\uB97C \uBABB\uD569\uB2C8\uB2E4. \uD558\uB8E8 \uC544\uAE30\uB791 \uC804\uC7C1\uD558\uACE0 \uC5B4\uC81C \uC800\uB141\uC740 \uC815\uB9D0 \uBBF8\uCE5C\uB4EF\uC774 \uC7A0\uB9CC \uC7A4\uC2B5\uB2C8\uB2E4. \uB355\uBD84\uC5D0 \uC544\uCE68\uC5D0 \uC77C\uC5B4\uB098\uC790 \uB9C8\uC790 \uC544\uB0B4\uC5D0\uAC8C \uAD6C\uBC15 \uBC1B\uC558\uC2B5\uB2C8\uB2E4. \u3160\u3160",
