  "text" : "\uC5B4\uC81C \uC800\uB141\uC5D0 \uADC0\uB69C\uB77C\uBBF8\uAC00 \uC6B8\uC5C8\uC2B5\uB2C8\uB2E4. \uCD94\uBD84\uC774 \uCF54 \uC55E\uC774\uB124\uC694.. \uC5EC\uB984\uC744 \uB290\uAEF4\uBCF4\uC9C0\uB3C4 \uBABB\uD558\uACE0 \uAC00\uC744\uC774 \uB41C \uAC83 \uAC19\uC544 \uBA3C\uAC00 \uC544\uC27D\uC2B5\uB2C8\uB2E4. \uC62C \uD574 \uC5EC\uB984\uC740 \uC544\uB0B4\uC758 \uC784\uC2E0 \uB54C\uBB38\uC5D0 \uC815\uB9D0 \uC3DC\uC0B4\uAC19\uC774 \uC9C0\uB098\uAC04\uAC83 \uAC19\uC2B5\uB2C8\uB2E4.",
