  "text" : "\uB0B4\uB144 \uBD04\uC774 \uB418\uBA74 \uC774\uC81C \uC544\uB0B4\uC640 \uC544\uAC00\uC640 \uAC19\uC774 \uC0B0\uCC45\uC744 \uD558\uACA0\uB124\uC694.. 2006\uB144 \uBD04\uAE4C\uC9C0 \uD63C\uC790 \uC9C0\uB0B4\uB2E4\uAC00 3\uB144\uB3D9\uC548 \uC544\uB0B4\uC640 \uAC19\uC774 \uBCF4\uB0B4\uB2E4 \uC774\uC81C \uC544\uAC00\uC640\uB3C4 \uBCF4\uB0B4\uACA0\uB124\uC694. \uC81C \uC0B6\uC774 \uB9CE\uC774 \uC5ED\uB3D9\uC801\uC774 \uB418\uC5C8\uC5B4\uC694. \uC544\uB0B4\uC5D0\uAC8C \uAC10\uC0AC.. \uC624\uB298\uC774 \uC544\uB0B4\uC640 \uB9CC\uB09C\uC9C0 1101\uC77C\uC9F8\uC785\uB2C8\uB2E4.",
