  "text" : "\uC5B4\uC81C \uCF04\uD2B8 \uBCA1\uC744 \uB9CC\uB0AC\uB294\uB370.. \uC81C\uAC00 \uB4E4\uACE0 \uC788\uB358 \uC644\uBCBD\uD55C \uCEE8\uC124\uD305\uC774\uB780 \uCC45\uC744 \uC790\uAE30\uB3C4 \uC88B\uC544\uD55C\uB2E4\uACE0 \uD558\uB354\uAD70\uC694. \uC81C\uAC00 \uC5B4\uB835\uB2E4\uACE0 \uB9D0\uD588\uB354\uB2C8 \uC790\uAE30\uB3C4 \uC5B4\uB835\uB2F5\uB2C8\uB2E4. \uBA3C\uAC00 \uAE30\uBD84\uC774 \uC88B\uC544\uC84C\uC2B5\uB2C8\uB2E4. \uC644\uBCBD\uD55C \uCEE8\uC124\uD305\uC774\uB780 \uCC45 \uC815\uB9D0 \uC5B4\uB835\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC77D\uC744\uC218\uB85D \uC6B0\uB7EC\uB098\uB294 \uB9DB\uC774 \uC77C\uD488..",
