  "text" : "\uC740\uB098\uB77C \uD558\uB098\uB77C\uB97C \uB3D9\uC774\uC871\uC758 \uAD6D\uAC00\uB85C \uC5F0\uAD6C\uD558\uB294 \uC0AC\uB78C\uB3C4 \uC788\uB2E4. \uACE0\uAD6C\uB824\uB294 \uB2E4\uBBFC\uC871\uAD6D\uAC00\uC600\uB2E4. \uACE0\uAD6C\uB824\uC758 \uC138\uACC4\uAD00\uACFC \uC911\uAD6D\uC758 \uC911\uD654\uAD00\uC740 \uD604\uACA9\uD788 \uB2E4\uB974\uB2E4. \uC9C0\uB09C 10\uB144\uAC04 \uBB38\uD654\uC7AC \uB3C4\uAD74\uB9CC 10\uB9CC\uAC74\uC774 \uB118\uB294\uB2E4. \uBB38\uD654\uC7AC\uC640 \uC5ED\uC0AC\uC5D0 \uB300\uD55C \uC6B0\uB9AC\uC758 \uC778\uC2DD\uC740 \uB3C8\uBC8C\uC774\uB97C \uBC97\uC5B4\uB098\uC9C0 \uBABB\uD55C\uAC74\uAC00?",
